import React from 'react';
import { Link } from 'react-router-dom';

class Home extends React.Component {
    render() {
        return (
            <div>
                <nav className="nav-bar">
                <Link to="/home">Home</Link>
                <Link to="/about">About</Link>
                </nav>
            </div>
        )
    }
}

export default Home;
